  const fetchData=async()=>{
    try{
      await axios.get('https://coursera-twitter-api.herokuapp.com/tweets')

    }catch(error){
      console.error(error)
    }
  }
  useEffect(()=>{
    console.log("here")
    fetchData()
  })




  return (
    //<h1>Hello,world! <h1/>
    <Tweet text='Text Passed Down' author='david' date='11/26/2022'/>
  );
}

export default App;
